import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Open a modal by clicking a product card (use text selector for "Shop now" CTA to trigger modal)
    // Try to find a product card and click it to open the modal
    // Use a unique product title text from the HTML (e.g., "Apple iPhone 15 Pro Max")
    await page.waitForSelector('text=Apple iPhone 15 Pro Max', { timeout: 5000 });
    await page.click('text=Apple iPhone 15 Pro Max');

    // Wait for the modal to appear (modal has class 'modal', but is only visible when style.display != 'none')
    // Wait for the close button inside modal (span.close) to be visible
    await page.waitForSelector('.modal[style*="display: block"]', { timeout: 5000 });
    await page.waitForSelector('.modal[style*="display: block"] .close', { timeout: 5000 });

    // Take screenshot with modal open
    const modalOpenShot = path.join(screenshotsDir, 'step_2_modal_open.png');
    await page.screenshot({ path: modalOpenShot });
    screenshots.push(modalOpenShot);

    // Press Escape to close the modal
    await page.keyboard.press('Escape');

    // Wait for the modal to be hidden (display: none or not visible)
    await page.waitForSelector('.modal', { state: 'hidden', timeout: 5000 });

    // Take screenshot after closing modal
    const modalClosedShot = path.join(screenshotsDir, 'step_3_modal_closed.png');
    await page.screenshot({ path: modalClosedShot });
    screenshots.push(modalClosedShot);

    // Extract data to verify modal is closed (should not find visible modal)
    const modalVisible = await page.$eval('.modal', el => {
      return window.getComputedStyle(el).display !== 'none';
    }).catch(() => false);

    return {
      success: true,
      action: "Opened product modal, closed it with Escape key, and verified modal is closed.",
      extractedData: {
        modalVisibleAfterEscape: modalVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
